import { Button } from '@material-ui/core';
import React from 'react';
import Navbar from '../Navbar/Navbar';

const LandingPage = () => {
    return (
        <div>
          <Navbar/>
          <div>
              <Button variant="contained">Login</Button>
              <Button variant="outlined">Sign Up</Button>
          </div>
        </div>
    );
}

export default LandingPage;
